import React from "react";
import { Switch, Route } from "react-router-dom";
import { HomeScreen } from "../modules/home-page.page";

export const Routes = () => {
  return (
    <Switch>
      <Route exact path="/" component={HomeScreen} />
    </Switch>
  );
};
